const Favorites = () => {
    const favorites = [];

    return (
        <section>
            {favorites.length > 0 ? (
                favorites.map(e => (
                    <div key={e.id}>
                        xuy
                    </div>
                ))
            ) : (
                <div className="empthyFavs">
                    <h1>You haven't choose yet</h1>
                </div>
            )}
        </section>
    );
};

export default Favorites;
